import React from 'react'
import {Spinner} from 'react-bootstrap'

export default function Redirecting() {
    return (
        <div>
            <h3>Przekierunkowanie do odpowiedniej strony</h3>
            <Spinner animation="border" variant="warning" />
        </div>
    )
}
